import React, { useEffect } from "react";
import SearchIcon from "@mui/icons-material/Search";
import PersonIcon from "@mui/icons-material/Person";
import ShoppingCartIcon from "@mui/icons-material/ShoppingCart";
import "./Header.css";
import { useDispatch } from "react-redux";
import { useSelector } from "react-redux";
import { open, alldata } from "../redux/closeSlice";
import { closeModal } from "../actions/index";

function Header() {
  const dispatch = useDispatch();

  const tmp = useSelector((state) => state.isclose);

  //const tmp = useSelector((state) => state.closeOpt.action);
  useEffect(() => {
    // dispatch(alldata());
    //console.log("hah" + tmp);
  }, []);

  return (
    <>
      <div className="headerContainer">
        <div className="logo">
          <div className="logoPart">
            <p>Management</p>
          </div>
          <div className="small">
            <p>Chuwa</p>
          </div>
        </div>

        <div className="searchPart">
          <input placeholder="Search" type="text"></input>

          <SearchIcon className="search_icon" />
        </div>

        <div className="right-header">
          <div className="signIn">
            <PersonIcon fontSize="large" className="signin_icon" />
            {/* <p onClick={() => dispatch(open())}>Sign in</p> */}
            <p onClick={() => closeModal(dispatch)()}>Sign in</p>
          </div>
          <div className="cart">
            <ShoppingCartIcon
              fontSize="medium"
              style={{ color: "white" }}
              className="cart_icon"
            />
            <p onClick={() => dispatch(alldata())}>$0.00</p>
          </div>
        </div>
      </div>
    </>
  );
}

export default Header;
